import React from "react";
import Button from "@material-ui/core/Button";

const navbar = props => {


  return (
    <div className="button-cont">
      {props.storedAircraftButtonHandler}
      <Button
        variant="contained"
        color="primary"
        onClick={props.preventNaNHandler}
      >
        Submit
      </Button>
    </div>
  );
};

export default navbar;
